con:configuration.path:
declare namespace s='${soapenv}';
declare namespace ns1='${xmlns}';
//s:Envelope

con:config.script:
def xmlns = com.eviware.soapui.SoapUI.globalProperties.getPropertyValue( "xmlns" )
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context );   
def holder = groovyUtils.getXmlHolder( 'initiateIntraDay#Response' ); 
holder.namespaces["ns"] = xmlns;
def list = []
for( item in holder.getNodeValues( "//ns:payload" ))
{
	list.add(item)
}
payload =list[0]
//get accountUid1
int index1 = payload.indexOf("acct uid", 0)
int index2 = payload.indexOf(" cuid", index1)
testRunner.testCase.testSuite.setPropertyValue( "acctUid1", payload.substring(index1+10, index2-1) )
log.info testRunner.testCase.testSuite.getPropertyValue( "acctUid1" )
//get accountUid2
index1 = payload.indexOf("acct uid", index1+1)
index2 = payload.indexOf(" cuid", index1)
testRunner.testCase.testSuite.setPropertyValue( "acctUid2", payload.substring(index1+10, index2-1) )
log.info testRunner.testCase.testSuite.getPropertyValue( "acctUid2" )
//get cuid
index1 = payload.indexOf("cuid", index1)
index2 = payload.indexOf(">", index1)
testRunner.testCase.testSuite.setPropertyValue( "cuid", payload.substring(index1+6, index2-1) )
log.info testRunner.testCase.testSuite.getPropertyValue( "cuid" )

